import React, { Component } from 'react';

import {
  BrowserRouter as Router,
  Route,
  Redirect
} from "react-router-dom";
import { NavBar } from '../components'
import { Login, Admin, OrdersHistory, Home, ManageUsers, Register } from '../pages'

const fakeAuth = {
 isAuth:false,
 auth(cb) {
   this.isAuth = true
   setTimeout(cb,100)
 },
  signOut(cb) {
    this.isAuth = false
    setTimeout(cb,100)
  }
}

    const PrivateRoute=({component:Component, ...rest})=>{
      <Route {...rest} render={(props) =>{
        fakeAuth.isAuth === true
        ? <Component {...props}/>
        :  <Redirect to="/"/>

      }}

      />
    }
class App extends Component {
  render() {
    return (

      <Router>
        <Route exact path="/">
          <Login />
        </Route>

        <PrivateRoute exact path="/home">
        <NavBar> 
        </NavBar>
          <Home />
        </PrivateRoute>

        <PrivateRoute exact path="/admin">
        <NavBar> 
        </NavBar>
          <Admin path="../pages" />
        </PrivateRoute>

        <PrivateRoute exact path="/admin/register">
        <NavBar> 
        </NavBar>
          <Register path="../pages" />
        </PrivateRoute>

        <PrivateRoute exact path="/admin/ManageUsers">
        <NavBar> 
        </NavBar>
          <ManageUsers path="../pages" />
        </PrivateRoute>
        <PrivateRoute exact path="/admin/ordershistory">
        <NavBar> 
        </NavBar>
          <OrdersHistory path="../pages" />
        </PrivateRoute>

      </Router>
    )
  }
}
export default App
